import "./App.css";

function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <p>This is a paragraph.</p>
      <img
        src="http://pages.cpsc.ucalgary.ca/~carey/CPSC441/ass1/Floppy.jpg"
        alt="My boy Floppy"
        width="200"
        height="300"
      />
      <div>
        <button>Test</button>
      </div>
    </div>
  );
}

export default App;
